{
  "translationLines": [
    {
      "lineNumber": 18941,
      "originalJapaneseLine": "「……………………」",
      "translatedEnglishLine": "「…………………」"
    },
    {
      "lineNumber": 18942,
      "originalJapaneseLine": "「……………………」",
      "translatedEnglishLine": "「…………………」"
    },
    {
      "lineNumber": 18943,
      "originalJapaneseLine": "空気が、凍っていた。",
      "translatedEnglishLine": "The atmosphere was frozen."
    },
    {
      "lineNumber": 18944,
      "originalJapaneseLine": "「…………何よ」",
      "translatedEnglishLine": "「...What is it?」"
    },
    {
      "lineNumber": 18945,
      "originalJapaneseLine": "「いやいや。何、て。",
      "translatedEnglishLine": "「No, no. What do you mean, 'what'?」"
    },
    {
      "lineNumber": 18946,
      "originalJapaneseLine": "　ツッコミ待ちかいな」",
      "translatedEnglishLine": "　Are you waiting for me to retort?」"
    },
    {
      "lineNumber": 18947,
      "originalJapaneseLine": "「……ロックアースの市長職は、",
      "translatedEnglishLine": "「...The mayoral position of Rock Earth"
    },
    {
      "lineNumber": 18948,
      "originalJapaneseLine": "　公式に解かれたわけではないし」",
      "translatedEnglishLine": "has not officially been dismissed, you know.\""
    },
    {
      "lineNumber": 18949,
      "originalJapaneseLine": "「だいたい、あの総統のせいよ。",
      "translatedEnglishLine": "「Besides, it's that president's fault."
    },
    {
      "lineNumber": 18950,
      "originalJapaneseLine": "　ロックアース関連の処理をさせるからって……",
      "translatedEnglishLine": "Because he made me handle matters related to Rock Earth..."
    },
    {
      "lineNumber": 18951,
      "originalJapaneseLine": "　私だってノコノコ出たくなかったわ」",
      "translatedEnglishLine": "I didn't want to show up all casually either.\""
    },
    {
      "lineNumber": 18952,
      "originalJapaneseLine": "「えぇと……そうではなく。",
      "translatedEnglishLine": "「Um... not exactly."
    },
    {
      "lineNumber": 18953,
      "originalJapaneseLine": "　その……姿形が驚きだと思うのですが……」",
      "translatedEnglishLine": "I mean... I am surprised by your appearance...\""
    },
    {
      "lineNumber": 18954,
      "originalJapaneseLine": "「うわ、そのまま言った！　真面目か！」",
      "translatedEnglishLine": "「Wow, you just said it straight! So serious!\""
    },
    {
      "lineNumber": 18955,
      "originalJapaneseLine": "「え、あ、まずかった……ですか？」",
      "translatedEnglishLine": "「Eh, ah, was that bad...?\""
    },
    {
      "lineNumber": 18956,
      "originalJapaneseLine": "「や、まずいって事ぁないがよ……」",
      "translatedEnglishLine": "「No, I wouldn't say it's bad, but...\""
    },
    {
      "lineNumber": 18957,
      "originalJapaneseLine": "「いいじゃないの。",
      "translatedEnglishLine": "「It's fine, you know."
    },
    {
      "lineNumber": 18958,
      "originalJapaneseLine": "　カチューシャさんが可愛らしくなっただけよ」",
      "translatedEnglishLine": "Katjusha has just become cuter.\""
    },
    {
      "lineNumber": 18959,
      "originalJapaneseLine": "「そ、そうですな。",
      "translatedEnglishLine": "「Y-Yes, that's right."
    },
    {
      "lineNumber": 18960,
      "originalJapaneseLine": "　女性の見た目に関して、",
      "translatedEnglishLine": "When it comes to women's appearances,"
    },
    {
      "lineNumber": 18961,
      "originalJapaneseLine": "　男性陣があれこれ言うのはセクハラです」",
      "translatedEnglishLine": "the men commenting about it is sexual harassment.\""
    },
    {
      "lineNumber": 18962,
      "originalJapaneseLine": "「……………………はぁ」",
      "translatedEnglishLine": "「………Hah.」"
    },
    {
      "lineNumber": 18963,
      "originalJapaneseLine": "ふわりとした癖毛を、",
      "translatedEnglishLine": "Katjusha irritably ran her fingers through her soft wavy hair."
    },
    {
      "lineNumber": 18964,
      "originalJapaneseLine": "カチューシャは苛立たしげに掻き回した。",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 18965,
      "originalJapaneseLine": "「くだらない話で時間を浪費してる場合？",
      "translatedEnglishLine": "「Are we wasting time on such trivial talk?"
    },
    {
      "lineNumber": 18966,
      "originalJapaneseLine": "　さっさと終わらせてもらえるかしら」",
      "translatedEnglishLine": "Can we finish this quickly?\""
    },
    {
      "lineNumber": 18967,
      "originalJapaneseLine": "「んー。まあ、せやなぁ。ほな始めまひょか」",
      "translatedEnglishLine": "「Hmm. Yeah, you're right. Well then, shall we get started?\""
    },
    {
      "lineNumber": 18968,
      "originalJapaneseLine": "「というわけで、ここの輸送ルートが、",
      "translatedEnglishLine": "「So, this transport route here"
    },
    {
      "lineNumber": 18969,
      "originalJapaneseLine": "　襲撃が多くて使えぬそうで。別のルートを……」",
      "translatedEnglishLine": "has many attacks and can't be used. We need another route...\""
    },
    {
      "lineNumber": 18970,
      "originalJapaneseLine": "「それ、たぶん輸送計画が向こうに漏れてる。",
      "translatedEnglishLine": "「That probably means the transport plan has been leaked over there."
    },
    {
      "lineNumber": 18971,
      "originalJapaneseLine": "　立案者が抱き込まれてるわよ」",
      "translatedEnglishLine": "The planner has been compromised.\""
    },
    {
      "lineNumber": 18972,
      "originalJapaneseLine": "「むう……しかし立案者は真面目な男で……",
      "translatedEnglishLine": "「Hmm... but the planner is an earnest man..."
    },
    {
      "lineNumber": 18973,
      "originalJapaneseLine": "　それにMランドから離れていません。",
      "translatedEnglishLine": "And he hasn't left M-Land."
    },
    {
      "lineNumber": 18974,
      "originalJapaneseLine": "　魔物と接触した風には……」",
      "translatedEnglishLine": "It doesn't look like he's had contact with monsters...\""
    },
    {
      "lineNumber": 18975,
      "originalJapaneseLine": "「あ……もしかして、人間の裏切り者が……？」",
      "translatedEnglishLine": "「Ah... could it be a human traitor...?\""
    },
    {
      "lineNumber": 18976,
      "originalJapaneseLine": "「そんなもの、手紙で充分よ。",
      "translatedEnglishLine": "「Something like that can be handled with letters."
    },
    {
      "lineNumber": 18977,
      "originalJapaneseLine": "　家族の所在地か何か、確かめてみなさい。",
      "translatedEnglishLine": "Check where their family is located or something."
    },
    {
      "lineNumber": 18978,
      "originalJapaneseLine": "　私なら金や女よりまず家族を人質に取る」",
      "translatedEnglishLine": "If it were me, I'd take the family hostage before money or women.\""
    },
    {
      "lineNumber": 18979,
      "originalJapaneseLine": "「し、調べさせます……！」",
      "translatedEnglishLine": "「I-I'll have it investigated...!\""
    },
    {
      "lineNumber": 18980,
      "originalJapaneseLine": "「で、次は？」",
      "translatedEnglishLine": "「So, next?\""
    },
    {
      "lineNumber": 18981,
      "originalJapaneseLine": "「……こういう形で、医療品が全然足りないの。",
      "translatedEnglishLine": "「...In this way, medical supplies are completely insufficient."
    },
    {
      "lineNumber": 18982,
      "originalJapaneseLine": "　ゼスから取り寄せなくちゃいけないわ。",
      "translatedEnglishLine": "We have to order them from Zeth."
    },
    {
      "lineNumber": 18983,
      "originalJapaneseLine": "　ちょっとコパンドンさん、費用お願いできる？」",
      "translatedEnglishLine": "Hey, Copandon, could you cover the costs?\""
    },
    {
      "lineNumber": 18984,
      "originalJapaneseLine": "「は、はぁーー……またでっか……」",
      "translatedEnglishLine": "「Y-Yes... it’s big again...\""
    },
    {
      "lineNumber": 18985,
      "originalJapaneseLine": "「だって医療用品よ？　数が足りません、",
      "translatedEnglishLine": "「Because it's medical supplies, right? The numbers aren't enough,"
    },
    {
      "lineNumber": 18986,
      "originalJapaneseLine": "　我慢してくださいってわけにはいかないじゃない？",
      "translatedEnglishLine": "we can't just have people endure that, can we?"
    },
    {
      "lineNumber": 18987,
      "originalJapaneseLine": "　魔法使いは皆、前線に持っていっちゃうんだし！」",
      "translatedEnglishLine": "All the mages take them to the front lines, after all!\""
    },
    {
      "lineNumber": 18988,
      "originalJapaneseLine": "「あー、うー、あー、了解ですわ。",
      "translatedEnglishLine": "「Ah, uh, ah, understood."
    },
    {
      "lineNumber": 18989,
      "originalJapaneseLine": "　けど、も少し細かく検討して……」",
      "translatedEnglishLine": "But let's review it a bit more thoroughly...\""
    },
    {
      "lineNumber": 18990,
      "originalJapaneseLine": "「待ちなさい。竜角惨の単価がおかしい。",
      "translatedEnglishLine": "「Wait. The unit price of Dragon Horn Powder is strange."
    }
  ]
}

